import React from 'react';
/**
 * LoginImage is the first image in the login.
 */
function LoginImage(){
    return (
        <div className="login100-pic js-tilt" data-tilt>
            <img src={require('../assets/images/login.png')} alt="IMG" />
        </div>
    )
}
export default LoginImage;
